import React, { useState, useEffect } from "react";
import { Helmet } from "react-helmet";
const Shop = () => {
    const cardArr = [
        {
            id: 1,
            text: "Hey this is a test.",
            img: " ",
            like: 0
        },
        {
            id: 2,
            text: "If this works I'll call it a day.",
            img: " ",
            like: 0
        },
        {
            id: 3,
            text: "I'll drink a lot of beer.",
            img: " ",
            like: 0
        },
        {
            id: 4,
            text: "Cheers",
            img: " ",
            like: 0
        
        }]
        
          const [like, setState] = useState([]);
          IncrementItem = () => {
            this.setState({ like: this.state.like + 1 });
          }
          DecreaseItem = () => {
            this.setState({ like: this.state.like - 1 });
          }
          const CardAddr = () => {
              return (
                <div key={this.state.id}>
                    {this.state.text}
                    <img src={this.state.img}/>
                    <p>Like Button</p>
                    <button onClick={this.IncrementItem}>Like</button>
                    <p>Dilike Button</p>
                    <button onClick={this.DecreaseItem}>Disike</button>
                    <p>Likes: {this.state.like}</p>
                </div>
            )
              }
    } 
        class oop extends React.Component {
          constructor(props) {
            super(props);
            this.state = {
              show: true
            };
          }
        
        render() {
            const cardList = (cardArr.map((card) => 
                <ul key={card.id}>
                    <li>
                      <CardAddr card={card}/>
                    </li>
                </ul>
            ));
        
            return(
                <div id='card'>
                    {cardList}
                    
                </div>
            )
        }
        }
export default Shop;
